#include <array>

using namespace std;

#define endl "\n"


int main() {
    std::ios_base::sync_with_stdio(0);
    cin.tie(0);
    cout.precision(10);

    string s;
    cin >> s;
    int n = s.size();
    int result = 0;
    int sign = 1;
    int curr = 0;
    for (int i = 0; i < n; ++i) {
        if (s[i] == '+') {
            result += sign * curr;
            curr = 0;
            sign = 1;
        } else if (s[i] == '-') {
            result += sign * curr;
            curr = 0;
            sign = -1;
        } else if (s[i] == '*') {
            result += sign * curr;
            curr = 0;
            sign = 1;
        } else if (s[i] == '=') {
            result += sign * curr;
            curr = 0;
            sign = 1;
        } else {
            curr = curr * 10 + s[i] - '0';
        }
    }
    cout << result << endl;

    return 0;
}
